import React, {Component} from 'react';
// import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route} from "react-router-dom";

import Navbar from "./components/navbar.component"
import ExercisesList from "./components/exercises-list.component";
import EditExercise from "./components/edit-exercise.component";
import CreateExercise from "./components/create-exercise.component";
import CreateUser from "./components/create-user.component";



export default class App extends Component {
  state = {
    backendAddress:  'https://et-exercise-tracker.herokuapp.com/' || 'http://localhost:5000/',

  }
  render() {
      // const backendAddress=  'https://et-exercise-tracker.herokuapp.com/' || 'http://localhost:5000/';

    return (
      <React.Fragment>
              <CreateExercise backendAddress={this.state.backendAddress} />


    <Router>
     <div className="container">
      <Navbar />
      <br/>
      <Route path="/" exact component={ExercisesList} />
      <Route path="/edit/:id" component={EditExercise} />
      <Route path="/create" component={CreateExercise} />
      <Route path="/user" component={CreateUser} />
      </div>
   </Router>
   </React.Fragment>
    )
  }
}
